const useStyles = makeStyles(() =>({
    root :{
        maxWidth : '100%',
        color:"blue",
        '&:hover': { 
            backgroundColor : 'blue',
           }
    },
    media :{
        height:0,
        paddingTop:'56.25%',
    },
    CardContent:{
        display:'flex',
        justifyContent :'space-between',
    },
    hee : {
        color:'blue',
    }

}))
export default useStyles;
